import React from 'react';
import Header from './component/header';
import Headline from '/component/headline'
import './App.css';

function App() {
  return (
    <div className="App">
    	<Header />
    	<section className="main">
    		<Headline /> 
    	</section>
    </div>
  );
}

export default App;
